screenshot of a twitter exchange, dated Sept 23 2024: 

@MaliceDaFirenze: We're making a game where you play a courier rier in 13th century Mongolia. No combat, just you, the horse(s) you've tamed, bred and trained and the vast wilderness. Would you play this? (10k replies, 11k reposts, 131k likes)

@doodlewhale: I would love to, as long as it can avoid woke DEI nonsense which appears unlikely as you have pronouns in your bio (shrug emoji) (337 replies, 124 reposts, 10k likes)

@MaliceDaFirenze: For every comment like this, I will add one extra pronoun to the game. (2k replies, 700 reposts, 19k likes)

